import React from "react";
import Logo from "../assets/logo.png";
import { Link } from "react-router-dom";
import SearchIcon from "./customicons/SearchIcon";

function Header() {
  return (
    <header className='header'>
      <div className='logo-box header__logo'>
        <img src={Logo} alt='header-logo' />
      </div>
      <nav className='text-lg flex header__nav '>
        <Link to='/recreation' className='header__nav--item'>
          Recreation Centers
        </Link>
        <Link to='/weather' className='header__nav--item'>
          Weather
        </Link>
        <Link to='/hotels' className='header__nav--item'>
          Hotels
        </Link>
        <Link to='/travel' className='header__nav--item'>
          Travel Advice
        </Link>
      </nav>
      <SearchIcon className='header__search-icon' />
    </header>
  );
}

export default Header;
